import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./DogRunPage.css";
import DogrunImage from "../assets/images/Dogrun/dogrun.png";
import Header from "../Header";
import Footer from "../Footer";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation"
import "swiper/css/pagination";



interface Store {
  id: number;
  name: string;
  img: string;
  description: string;
}

const DogRunPage: React.FC = () => {
  const navigate = useNavigate();
  const [stores, setStores] = useState<Store[]>([]);

  const handleClick = () => {
    navigate('/DogrunRegionsList');
  };

useEffect(()=> {
  //店舗データを取得
  const fetchStores = async () => {
    try {
      const response = await fetch("http://localhost:5003/stores");
      const data: Store[] = await response.json();
      setStores(data);
    } catch (error) {
    }
  };

  fetchStores();
}, []);

useEffect(() => {
  stores.forEach((storeItem) => {
    console.log("取得した店舗情報:", storeItem);
  });
}, [stores]);

  return (
    <>
      <Header />
      <div className="dogrun-page-container">
        <p onClick={handleClick} className="search-dogrun">
          全国のドッグランを探す
        </p>
        <div>
          <img src={DogrunImage} alt="DogrunImage" className="dogrun-image" />
        </div>
        <div className="store-list">
          {stores.map((store) => (
            <div key={store.id} className="store-card">
              <img src={store.img} alt={store.name} className="store-image" />
              <h3>{store.name}</h3>
            </div>
          ))}
<div className="wave-section">
  <svg className="wave" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320">
    <path fill="##C19A6B" d="M0,256L48,240C96,224,192,192,288,181.3C384,171,480,181,576,181.3C672,181,768,171,864,149.3C960,128,1056,96,1152,106.7C1248,117,1344,171,1392,197.3L1440,224L1440,320L1392,320C1344,320,1248,320,1152,320C1056,320,960,320,864,320C768,320,672,320,576,320C480,320,384,320,288,320C192,320,96,320,48,320L0,320Z"></path>
  </svg>
</div>



        </div>
      </div>

      <Footer/>
    </>

  );
};


export default DogRunPage;
